        for (Iterator it = list.iterator(); it.hasNext(); ) {
            String s = it.next();
            System.out.println(s);
        }
    }

    public static void Method3() {
        List list = List.of("阿达硕大的所", "嘎嘎嘎嘎嘎", "发");
